import React from "react";
import  ReactDOM  from "react-dom";
import './index.css';

const fname = "Munesh";
const lname = "Goyal";
let date =new Date().toLocaleDateString();
let time = new Date().toLocaleTimeString();
const image1 = "https://picsum.photos/200/300";
const image2 = "https://picsum.photos/250/300";
const image3 = "https://picsum.photos/300/300";
const links = "https://www.javatpoint.com/java-tutorial";
const heading ={

    color : "red",
    // kebab case
    textTransform : "capitalize"             

}
ReactDOM.render(<>
  {/* <h1 className="heading">Core Java Tutorial</h1> */}
  <h1>Core Java Tutorial</h1>
  <p>Our core Java programming tutorial is designed for students and working professionals. Java is an object-oriented, class-based, concurrent, secured and general-purpose computer-programming language. It is a widely used robust technology.</p>
  <ol>
    <li>Java Control Statements</li>
    <li>Java if-else Statements</li>
    <li>Java for-loops</li>
  </ol>
     {/* use of javascript element into html */}
  <h2>This site is generated by {fname + " " + lname}</h2> 
  <h2>{`This site is generated by ${fname} ${lname}`}</h2>         
  <h3>Total Visiors ={Math.random()+6}</h3>

  <h1>{`My name is ${fname} ${lname}`}</h1>
  <h3>{`Current Date is ${date}`}</h3>
  <h3>{`Current Time is ${time}`}</h3>
  {/* //jsx attributes */}
  <h1 contentEditable="true">My name is {fname + " " + lname}</h1>  
  <div className="Images">
  <img src={image1} alt="randomImages"/>
  <img src={image2} alt="randomImages"/>
  <a href={links} target = "_hello">
  <img src={image3} alt="randomImages"/>
  </a>
  </div>
</>,document.getElementById('root'));
